import React, { Component } from "react";

export default class ArticleVideo extends Component {
  render() {
    const { videoSrc } = this.props;
    return (
      <div className="article-video-container">
        <video
          playsInline
          loop
          muted
          src={videoSrc}
          className="article-video"
        />
      </div>
    );
  }
}
